import React, { Component } from "react";
import data from "./data";
import "./Header.css";

console.log(this.props);
class Pokemons extends Component{
    render(){
    return(
    <section className="poke">
     <h3>{data[1].name} </h3>
     <p>{data[1].type} </p>
     <p>{data[1].averageWeight.value} {data[1].averageWeight.measurementUnit} </p>
     <img src = {data[1].image} alt="Imagem do Pokemon"/>

    </section>

    )
}
}

export default Pokemons
